webpackJsonp([74998184087],{9137:function(N,e){N.exports={pathContext:{group:[{node:{fields:{title:"Butt naked",date:"24 Jul 2001",slug:"/2001-07-24-butt-naked/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/07/crhsprinkler.jpg" height="225" width="300" border="0" alt="crhsprinkler.jpg: " /></p>\n<p>We have some pictures of Mama\'s trip to <a href="http://www.shcon.com/index.php?album=2001%2F20010724-berlin&dispsize=512&start=0">Berlin</a> today, and of <a href="http://www.shcon.com/index.php?album=2001%2F20010724-crh&dispsize=512&start=0">Christopher</a> in the backyard after she got home.</p>'},next:{fields:{title:"No news would have been good news",date:"22 Jul 2001",slug:"/2001-07-22-no-news-would-have-been-good-news/"}},previous:{fields:{title:"Globalization begins at home",date:"25 Jul 2001",slug:"/2001-07-25-globalization-begins-at-home/"}}},{node:{fields:{title:"No news would have been good news",date:"22 Jul 2001",slug:"/2001-07-22-no-news-would-have-been-good-news/",tags:"Y2001"},html:"<p>Photo albums, next attempt. This time I'm going to try to do it myself: http://www.shcon.com.</p>\n<p>Looks like <a href=\"http://www.vfth.com\">Al</a> has been bitten by the hiatus bug. Hope it doesn't last too long. <i>It lasted about 2 hours!</i></p>\n<p>A sign of adulthood: I'm starting to worry more about the state of the world I'm giving to my son and less about the one I inherited from my parents.</p>\n<p>My mom got caught out-of-town in a tornado warning yesterday. As the radio advised anyone in a car or trailer to seek shelter immediately, she pulled up to nearest house with lights on. The family took them down to their basement, and even invited her to stay for coffee after the storm had passed.</p>"},next:{fields:{title:"Drunk and disorderly",date:"20 Jul 2001",slug:"/2001-07-20-drunk-and-disorderly/"}},previous:{fields:{title:"Butt naked",date:"24 Jul 2001",slug:"/2001-07-24-butt-naked/"}}},{node:{fields:{title:"Drunk and disorderly",date:"20 Jul 2001",slug:"/2001-07-20-drunk-and-disorderly/",tags:"Y2001"},html:"<p>In a back-to-the-basics action, Mama is this evening working the closing shift at one of her inner-city restaurants. I'm sure she'd appreciate some unruly customers at the Dammtor train station around midnight tonight, if you happen to be in the area.</p>\n<p>I wish I could be at the Metrodome for the 4-game Mariners-Twins series this weekend.</p>\n<pre>193.xxx.118.xx - - [19/Jul/2001:14:42:57 -0400] \n\"GET /default.ida?NNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNN\nNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNN\nNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNN\nNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNNN\nNNNNNNNNNNNNNNNNNN%u9090%u6858%ucbd3%u7801%u9090%u6858\n%ucbd3%u7801%u9090%u6858%ucbd3%u7801%u9090%u9090%u8190\n%u00c3%u0003%u8b00%u531b%u53ff%u0078%u0000\n%u00=a  HTTP/1.0\" 404 205</pre>\n<p>... just in case you're wondering what <a href=\"http://news.cnet.com/news/0-1003-200-6604515.html\">code red</a> looks like. Then again, I'm sure most webmasters have several dozen of these in their log files.</p>"},next:{fields:{title:"Christopher inside",date:"19 Jul 2001",slug:"/2001-07-19-christopher-inside/"}},previous:{fields:{title:"No news would have been good news",date:"22 Jul 2001",slug:"/2001-07-22-no-news-would-have-been-good-news/"}}}],pathPrefix:"",first:!1,last:!1,index:988,pageCount:1101}}}});
